import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getAllKyc } from "../../actions/adminActions";
import VisibilityIcon from '@mui/icons-material/Visibility';

const AdminAllKyc = () => {
  const dispatch = useDispatch();
  const kyc = useSelector((state) => state.allKyc);

  const [ed, setEd] = useState(false);


  console.log(kyc);

  useEffect(() => {
    dispatch(getAllKyc());
  }, []);

  return (
    <div>
      {kyc?.data
        ? kyc?.data?.map((el) => {
            return (
              <div className="allkyc-box">
                <div>
                  <p>{el?.owner?.name}</p>
                  <p style={{marginTop: '-20px'}} > <strong>{el?.owner?.email}</strong></p>
                </div>

                <button><VisibilityIcon /></button>
              </div>
            );
          })
        : ""}

        {ed ? '' : ''}
    </div>
  );
};

export default AdminAllKyc;
